import React, { useState, useEffect } from 'react';
import { Calendar, Plus, CheckCircle, Circle, AlertCircle } from 'lucide-react';


function App() {
  const auth = useAuth();

  // Cognito configuration
  const clientId = "hfjkv26lfqqnjsi6lc7kj51ih";
  const cognitoDomain = "https://eu-west-1qpsd45zzz.auth.eu-west-1.amazoncognito.com";
  const logoutUri = "<logout uri>";
  const signUpUri = `${cognitoDomain}/signup?client_id=${clientId}&response_type=code&scope=openid+profile+email&redirect_uri=${encodeURIComponent(window.location.origin)}`;

  const signOutRedirect = () => {
    window.location.href = `${cognitoDomain}/logout?client_id=${clientId}&logout_uri=${encodeURIComponent(logoutUri)}`;
  };

  if (auth.isLoading) {
    return <div>Loading...</div>;
  }

  if (auth.error) {
    return <div>Encountering error... {auth.error.message}</div>;
  }

  if (auth.isAuthenticated) {
    return (
      <div>
        <div className="bg-gray-100 p-4">
          <h1 className="text-xl font-semibold mb-4">Welcome, {auth.user?.profile.email}</h1>
          <div className="flex space-x-4 mb-6">
            <button
              onClick={() => auth.removeUser()}
              className="px-4 py-2 bg-red-500 text-white rounded-md hover:bg-red-600"
            >
              Sign Out
            </button>
          </div>
        </div>
        {/* Render Dashboard */}
        <Dashboard />
      </div>
    );
  }

  return (
    <div className="bg-gray-100 min-h-screen flex items-center justify-center">
      <div className="p-6 bg-white rounded-md shadow-md text-center">
        <h1 className="text-2xl font-semibold mb-4">Task Management App</h1>
        <div className="space-x-4">
          <button
            onClick={() => auth.signinRedirect()}
            className="px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-600"
          >
            Sign In
          </button>
          <button
            onClick={() => (window.location.href = signUpUri)}
            className="px-4 py-2 bg-green-500 text-white rounded-md hover:bg-green-600"
          >
            Sign Up
          </button>
        </div>
      </div>
    </div>
  );
}

const Dashboard = ({ auth }) => {
  const [tasks, setTasks] = useState([]);
  const [isAdmin, setIsAdmin] = useState(false);
  const [showCreateDialog, setShowCreateDialog] = useState(false);
  const [users, setUsers] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (!auth.isAuthenticated) return;

    // Determine user role from auth object
    const role = auth.user?.profile["custom:role"];
    setIsAdmin(role === 'ADMIN');

    // Fetch tasks and users if authenticated
    fetchTasks();
    if (role === 'ADMIN') {
      fetchUsers();
    }
  }, [auth]);

  const fetchTasks = async () => {
    try {
      const response = await fetch('/api/tasks', {
        headers: {
          Authorization: `Bearer ${auth.user?.access_token}`,
        },
      });
      if (!response.ok) {
        throw new Error('Failed to fetch tasks');
      }
      const data = await response.json();
      setTasks(data);
    } catch (error) {
      setError(error.message);
    }
  };

  const fetchUsers = async () => {
    try {
      const response = await fetch('/api/users', {
        headers: {
          Authorization: `Bearer ${auth.user?.access_token}`,
        },
      });
      if (!response.ok) {
        throw new Error('Failed to fetch users');
      }
      const data = await response.json();
      setUsers(data);
    } catch (error) {
      setError(error.message);
    }
  };

  const handleCreateTask = async (e) => {
    e.preventDefault();
    const formData = new FormData(e.target);
    try {
      const response = await fetch('/api/tasks', {
        method: 'POST',
        headers: {
          Authorization: `Bearer ${auth.user?.access_token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          title: formData.get('title'),
          description: formData.get('description'),
          assignee: formData.get('assignee'),
          deadline: formData.get('deadline'),
        }),
      });
      if (!response.ok) {
        throw new Error('Failed to create task');
      }
      setShowCreateDialog(false);
      fetchTasks();
    } catch (error) {
      setError(error.message);
    }
  };

  const handleUpdateStatus = async (taskId, newStatus) => {
    try {
      const response = await fetch(`/api/tasks/${taskId}`, {
        method: 'PUT',
        headers: {
          Authorization: `Bearer ${auth.user?.access_token}`,
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ status: newStatus }),
      });
      if (!response.ok) {
        throw new Error('Failed to update task status');
      }
      fetchTasks();
    } catch (error) {
      setError(error.message);
    }
  };

  const getStatusIcon = (status) => {
    switch (status.toLowerCase()) {
      case 'pending':
        return <Circle className="h-4 w-4 text-yellow-500" />;
      case 'in_progress':
        return <AlertCircle className="h-4 w-4 text-blue-500" />;
      case 'completed':
        return <CheckCircle className="h-4 w-4 text-green-500" />;
      default:
        return <Circle className="h-4 w-4 text-gray-500" />;
    }
  };

  return (
    <div className="p-6 max-w-7xl mx-auto">
      {/* Header */}
      <div className="bg-white rounded-lg shadow-sm p-6 mb-6">
        <div className="flex justify-between items-center">
          <h1 className="text-2xl font-semibold">Task Management Dashboard</h1>
          {isAdmin && (
            <button
              onClick={() => setShowCreateDialog(true)}
              className="px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-600 flex items-center"
            >
              <Plus className="h-4 w-4 mr-2" />
              Create Task
            </button>
          )}
        </div>
      </div>

      {/* Error Alert */}
      {error && (
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-6">
          {error}
        </div>
      )}

      {/* Tasks Table */}
      <div className="bg-white rounded-lg shadow-sm overflow-hidden">
        <div className="overflow-x-auto">
          <table className="w-full">
            <thead className="bg-gray-50">
              <tr>
                <th>Title</th>
                <th>Assignee</th>
                <th>Deadline</th>
                <th>Status</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {tasks.map((task) => (
                <tr key={task.task_id}>
                  <td>{task.title}</td>
                  <td>{task.assignee}</td>
                  <td>{new Date(task.deadline).toLocaleDateString()}</td>
                  <td>{getStatusIcon(task.status)} {task.status}</td>
                  <td>
                    <select
                      value={task.status}
                      onChange={(e) => handleUpdateStatus(task.task_id, e.target.value)}
                    >
                      <option value="PENDING">Pending</option>
                      <option value="IN_PROGRESS">In Progress</option>
                      <option value="COMPLETED">Completed</option>
                    </select>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Create Task Dialog */}
      {showCreateDialog && (
        <div>
          {/* Create Task Modal */}
        </div>
      )}
    </div>
  );
};

export default Dashboard;
